import React, { Component } from 'react';
import Particles from 'react-particles-js';
import Clarifai from 'clarifai';
import './App.css';
import Navigation from './Components/Navigation/Navigation';
import Logo from './Components/Logo/Logo';
import ImageLinkForm from './Components/ImageLinkForm/ImageLinkForm';
import Rank from './Components/Rank/Rank';

const app = new Clarifai.App({
    apiKey: '3b2d6a108b6549f2baa43151f6f6bd22'
});

const particlesOptions = {
    particles: {
        number: {
            value: 150,
            density: {
                enable: true,
                value_area: 800
            }
        }
    }
}

class App extends Component {
  constructor() {
      super();
      this.state = {
          input: '', //interact parent with children
      }
  }

onInputChange = (event) => {
      console.log(event.target.value); // When event happens, get the event value
}

onButtonSubmit = () => {
      console.log('click');
    app.models
        .predict("3b2d6a108b6549f2baa43151f6f6bd22",
        "https://2.bp.blogspot.com/-Ep17cGWnd8A/VjAZKatyYuI/AAAAAAAACN8/Ok0lrQ3MdTU/s320/costner.jpg")
        .then(
        function(response) {
            console.log(response);
            // do something with response
        },
        function(err) {
            // there was an error
        }
    );
}


  render() {
    return (
      <div className="App">
        <Particles className='particles'
        params={particlesOptions}
        />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit}/>
        {/*<FaceRecognition />}*/}
      </div>
    );
  }
}

export default App;
